import React from 'react';

function Awards() {
    return (
        <div>
            <h2>College Scholars Program</h2>
            <p>Selected as one of 60 students from 2000+ undergraduates to work closely with faculty
                through
                seminars and research in a 4-year honors program</p>
            <br/>
            <h2>Crescere Aude Scholarship</h2>
            <p>Awarded $6,000 scholarship for outstanding academic achievements and contributions to
                research</p>
        </div>
    );
}

export default Awards;
